void visitEnclosingElement(ImageElement element,
    ImageElement key, String value) throws IOException {
  elemQ.push(element);
  if(element == ImageElement.INODE)
    newLine();
  else if (element == ImageElement.BLOCKS)
    numBlocks = Integer.valueOf(value);
}
